if(document.querySelectorAll('.youtube-api').length !== 0){
  var tag = document.createElement('script');
  tag.src = "https://www.youtube.com/iframe_api";
  var firstScriptTag = document.getElementsByTagName('script')[0];
  firstScriptTag.parentNode.insertBefore(tag, firstScriptTag);

  var ytPlayer = [];
  var ytData = [];

  var target = document.querySelectorAll('.youtube-api');

  for (var i = 0; i < target.length; i++) {
    var thisID = target[i].dataset.id;
    var thisArea = target[i].id;
    var obj = {id: thisID, area: thisArea};
    ytData.push(obj);
  }

  //YouTube
  function onYouTubeIframeAPIReady() {
    for (var i = 0; i < ytData.length; i++) {
      var pl = ytData[i]['id'] + ',' + ytData[i]['id'];
      ytPlayer[i] = new YT.Player(ytData[i]['area'], {
        videoId: 'MzypEXT7eMQ',
        playerVars: {
          loop: 1,
          controls: 0,
          autoplay: 1,
          showinfo: 0,
          playsinline: 1
        },
        events: {
          'onReady': onPlayerReady,
          'onStateChange': function(event) {
            switch (event.data) {
              case YT.PlayerState.ENDED:
                event.target.playVideo();
                break;
            }
          }
        }
      });
    }
  }



  function onPlayerReady(event) {
    var player = event.target
    player.mute(); // 
    player.playVideo();
  }
}